import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';
import Header from '../components/Header';
import Footer from '../components/Footer';

const LoginPage: React.FC = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    email: '',
    password: '',
    rememberMe: false
  });
  const [userType, setUserType] = useState<'customer' | 'restaurant'>('customer');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    const { name, value, type, checked } = e.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    // TODO: Implement login logic
    console.log('Login submitted:', { ...formData, userType });
    alert(`Prihlásenie ako ${userType === 'customer' ? 'zákazník' : 'reštaurácia'} - funkcionalita bude implementovaná.`);
  };

  return (
    <div className="min-h-screen bg-gray-50">
      <Header />

      <main className="max-w-md mx-auto px-4 sm:px-6 lg:px-8 py-12">
        <div className="bg-white rounded-lg shadow-sm p-8">
          {/* Header */}
          <div className="text-center mb-8">
            <h1 className="text-3xl font-bold text-gray-900 mb-2">
              Prihlásenie
            </h1>
            <p className="text-gray-600">
              Prihláste sa do svojho účtu
            </p>
          </div>

          {/* User Type Toggle */}
          <div className="flex mb-6 bg-gray-100 rounded-lg p-1">
            <button
              type="button"
              onClick={() => setUserType('customer')}
              className={`flex-1 py-2 px-4 rounded-md text-sm font-medium transition-colors ${
                userType === 'customer'
                  ? 'bg-white text-foxi-orange shadow-sm'
                  : 'text-gray-600 hover:text-gray-900'
              }`}
            >
              Zákazník
            </button>
            <button
              type="button"
              onClick={() => setUserType('restaurant')}
              className={`flex-1 py-2 px-4 rounded-md text-sm font-medium transition-colors ${
                userType === 'restaurant'
                  ? 'bg-white text-foxi-orange shadow-sm'
                  : 'text-gray-600 hover:text-gray-900'
              }`}
            >
              Reštaurácia
            </button>
          </div>

          {/* Login Form */}
          <form onSubmit={handleSubmit} className="space-y-6">
            <div>
              <label htmlFor="email" className="block text-sm font-medium text-gray-700 mb-2">
                Email
              </label>
              <input
                type="email"
                id="email"
                name="email"
                required
                value={formData.email}
                onChange={handleChange}
                className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-foxi-orange focus:border-transparent"
                placeholder="vas@email.com"
              />
            </div>

            <div>
              <label htmlFor="password" className="block text-sm font-medium text-gray-700 mb-2">
                Heslo
              </label>
              <input
                type="password"
                id="password"
                name="password"
                required
                value={formData.password}
                onChange={handleChange}
                className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:ring-2 focus:ring-foxi-orange focus:border-transparent"
                placeholder="••••••••"
              />
            </div>

            <div className="flex items-center justify-between">
              <div className="flex items-center">
                <input
                  id="rememberMe"
                  name="rememberMe"
                  type="checkbox"
                  checked={formData.rememberMe}
                  onChange={handleChange}
                  className="w-4 h-4 text-foxi-orange border-gray-300 rounded focus:ring-foxi-orange"
                />
                <label htmlFor="rememberMe" className="ml-2 text-sm text-gray-600">
                  Zapamätať si ma
                </label>
              </div>

              <Link to="/forgot-password" className="text-sm text-foxi-orange hover:text-orange-600">
                Zabudli ste heslo?
              </Link>
            </div>

            <button
              type="submit"
              className="w-full btn-primary"
            >
              Prihlásiť sa
            </button>
          </form>

          {/* Social Login */}
          <div className="mt-6">
            <div className="relative">
              <div className="absolute inset-0 flex items-center">
                <div className="w-full border-t border-gray-300" />
              </div>
              <div className="relative flex justify-center text-sm">
                <span className="px-2 bg-white text-gray-500">alebo</span>
              </div>
            </div>

            <div className="mt-6 space-y-3">
              <button
                type="button"
                className="w-full flex justify-center items-center px-4 py-3 border border-gray-300 rounded-lg shadow-sm text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
              >
                <img className="w-5 h-5 mr-2" src="/api/placeholder/20/20" alt="Google" />
                Prihlásiť sa cez Google
              </button>

              <button
                type="button"
                className="w-full flex justify-center items-center px-4 py-3 border border-gray-300 rounded-lg shadow-sm text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
              >
                <img className="w-5 h-5 mr-2" src="/api/placeholder/20/20" alt="Facebook" />
                Prihlásiť sa cez Facebook
              </button>
            </div>
          </div>

          {/* Sign up link */}
          <div className="mt-6 text-center">
            <p className="text-sm text-gray-600">
              Nemáte ešte účet?{' '}
              {userType === 'customer' ? (
                <Link to="/signup" className="text-foxi-orange hover:text-orange-600 font-medium">
                  Zaregistrujte sa
                </Link>
              ) : (
                <Link to="/restaurant-signup" className="text-foxi-orange hover:text-orange-600 font-medium">
                  Registrácia reštaurácie
                </Link>
              )}
            </p>
          </div>
        </div>
      </main>

      <Footer />
    </div>
  );
};

export default LoginPage;
